import React, { Component } from 'react';
import VideoPlayer from 'react-simple-video-player';

export default class LayoutTemplateIntroduce extends Component {

    constructor(props) {
        super(props);
        this.state = {
        }
    }


    render() {

        return (
            <div style={{ width: "48%", height: "100%" }}>
                <div class="row">
                    <div class="col-xs-12 " >
                        <div class="section-heading alteration-fancy-heading">
                            <div class="heading">
                                <h2>CECI'STYLE</h2>
                                <span class="subheading">FASHION DESIGN AND ALTERATIONS</span>
                            </div>
                        </div>
                    </div>
                </div>
                <div class="row">
                    <div class="col-sm-3"/>
                    <div class="col-sm-6">
                        <VideoPlayer url="../videos/videocristina.mp4" poster="/myPoster.png" width={960} height={720} autoplay/>
                    </div>
                    <div class="col-sm-3"/>
                </div>
            </div>
        )
    }
}
